function sortStockLevel(rowA, rowB) {

    const a = rowA.values.stockLevel
    const b = rowB.values.stockLevel

    if (a === "High" && ["Low", "Medium", "High"].includes(b)) {
        return 1
    } else if (a === "Medium" && ["Low", "Medium"].includes(b)) {
        return 1
    } else if (a === "Low" && b === "Low") {
        return 1
    } else {
        return -1
    }
}


export {sortStockLevel}
